import { useCallback } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./SIGNIN.css";

const SIGNIN = () => {
  const navigate = useNavigate();

  const onSigninButtonClick = useCallback(() => {
    navigate("/6-dashboard-home");
  }, [navigate]);

  const onForgotPasswordClick = useCallback(() => {
    navigate("/4-forgot-passwordnew-password");
  }, [navigate]);

  const onSignUpClick = useCallback(() => {
    navigate("/5-sign-up");
  }, [navigate]);

  const onReturnButtonClick = useCallback(() => {
    navigate("/2-sign-in-sign-up");
  }, [navigate]);

  return (
    <div className="sign-in4">
      <img className="notocloud-icon7" alt="" src="/notocloud.svg" />
      <img className="notocloud-icon8" alt="" src="/notocloud.svg" />
      <div className="container2" />
      <img className="sign-in-child" alt="" src="/group-7.svg" />
      <div className="sign-in-item" />
      <img className="notocloud-icon9" alt="" src="/notocloud.svg" />
      <img
        className="wikang-wali-logo1"
        alt=""
        src="/wikang-wali-logo@2x.png"
      />
      <div className="welcome2">Welcome!</div>
      <div className="sign-in-to">Sign in to your Account</div>
      <input className="rectangle-password" type="password" />
      <img className="notocloud-icon10" alt="" src="/notocloud.svg" />
      <img className="notocloud-icon11" alt="" src="/notocloud1.svg" />
      <div className="email2">Email</div>
      <button className="signinbutton" onClick={onSigninButtonClick}>
        <div className="sign-in5">SIGN IN</div>
      </button>
      <div className="password2">Password</div>
      <div className="or-login-with">{`or login with `}</div>
      <Link
        className="forgot-password"
        to="/4-forgot-passwordnew-password"
        onClick={onForgotPasswordClick}
      >
        Forgot Password?
      </Link>
      <img className="vector-icon10" alt="" src="/vector2.svg" />
      <div className="email-border-parent">
        <input className="email-border" type="text" />
        <img className="group-icon6" alt="" src="/group1.svg" />
      </div>
      <img className="octiconlock-242" alt="" src="/octiconlock24.svg" />
      <div className="dont-have-an">Don’t have an account?</div>
      <Link className="sign-up4" to="/5-sign-up" onClick={onSignUpClick}>
        Sign Up
      </Link>
      <button className="return-button1" onClick={onReturnButtonClick}>
        <div className="return-button-item" />
        <img
          className="mingcuteback-line-icon1"
          alt=""
          src="/mingcutebackline.svg"
        />
      </button>
    </div>
  );
};

export default SIGNIN;
